    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 1:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 2:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 3:
        {
            v = (v > 3999 ? 3999 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 4000 ? 4000 : (v < 1 ? 1 : v));
            return v;
        }
    case 5:
        {
            v = (v > 36 ? 36 : (v < -36 ? -36 : v));
            return v;
        }
    default:
        return value;
    }
}
